import React from 'react';
import { Link, useLocation  } from 'react-router-dom';  // Ajoutez le 'from' ici
import styles from './header.module.css';
import logo from './logo .png';  // Supprimez l'espace inutile dans le nom du fichier

const Header: React.FC = () => {
  const location = useLocation();
  const { pathname } = location;
  return (
    <header className={styles.header}>
      <div className={styles.logoContainer}>
        <img src={logo} alt="Logo" className={styles.logo} />
      </div>
      <nav className={styles.navbar}>
        <ul className={styles.navList}>
          <li className={styles.navItem}><Link to="/acceuil">Accueil</Link></li>
          <li className={styles.navItem}><a href="#presentation">Pr√©sentation</a></li>
          <li className={styles.navItem}><a href="#consulter">Consulter</a></li>
          <li className={styles.navItem}><a href="#organizer">Organiser</a></li>
          <li className={styles.navItem}><a href="#partager">Partager</a></li>
          <li className={styles.navItem}><a href="#profil">Profil</a></li>
          <li className={styles.navItem}><a href="#contact">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
